SELECT LINEITEM.L_RETURNFLAG, PARTSUPP.PS_SUPPLYCOST, SUPPLIER.S_PHONE FROM LINEITEM JOIN PARTSUPP ON PARTSUPP.PS_SUPPKEY=LINEITEM.L_SUPPKEY JOIN SUPPLIER ON SUPPLIER.S_SUPPKEY=PARTSUPP.PS_SUPPKEY WHERE LINEITEM.L_DISCOUNT != 0.10 AND SUPPLIER.S_PHONE >= '33-990-965-2201' ORDER BY PARTSUPP.PS_SUPPLYCOST ASC, LINEITEM.L_RETURNFLAG ASC;
